import React from 'react';
import {StyledButton, StyledButtonList} from './styles';

type Props = {
    caption: string;
}

type ListProps = {
    children: React.ReactNode;
}

export function Button({caption}: Props){
    return(
        <StyledButton>
            {caption} 
        </StyledButton>
    );
};

export function ButtonList({children}: ListProps){
    return(
        <StyledButtonList>
            {children}
        </StyledButtonList>
    );
};
